// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;

contract EasyStorage{

    uint256 number = 15;
    string[] public listOfNames;

    function getNumber()public view returns (uint256) {
        return number;
    }
    constructor() {
        listOfNames.push("Dayo");
        listOfNames.push("Arinze");
        listOfNames.push("Nkenna");
        listOfNames.push("Timothy");
        listOfNames.push("Charles");
    }

    function getListOfNames() public view returns (string[] memory){
        return listOfNames;
    }

    struct loginDetails {
        string userName;
        string password;
        }

        loginDetails[] public users;

        function getUserList() public view returns (loginDetails[] memory){
            return users;
        }

       mapping (string => string) public loginData;

       function addNewUser(   string memory userName, string memory password) public {
        loginDetails memory newUser = loginDetails(userName,password);
        users.push(newUser);
        loginData[userName]= password;
       }

}

